column8:
・ビジネスにもカジュアルにも使えるメンズの一体成形ブーツです。<br>【サニーフィールズとは……】<br>「雨の日でもハッピーな気持ち」をコンセプトに、バラエティ豊かなアイテム展開が特徴のレインブランド。<br><br>【商品スペック】<br>[サイズ]: M(26cm)<br>[重量]: 約1kg<br>[企画国]: 日本<br>[素材]: 塩化ビニル樹脂100%<br>【販売上の注意】<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
</center>

